  false,\n\t\"url\": null,\n\t\"notes\": \"Project: NOAA Digital Orthophotography
  and Ancillary Oblique Imagery Collection for the Coasts of Main/New Hampshire, Massachusetts/Rhode
  Island/Connecticut, and Hudson River/Long Island /NY/NJ Contract No. EA133C11CQ0010
  Reference No. NCNP0000-14-00967 Woolpert Order No. 74571 CONTRACTOR: Woolpert, Inc.
  The project represents the collection of digital orthoimagery and ancillary oblique
  imagery for the coasts of Maine and New Hampshire; Massachusetts and Rhode Island;
  Connecticut, the Hudson River, Long Island and the NY/NJ metro area. The work was
  requested by the National Oceanic and Atmospheric Administration, Office of Response
  and Restoration division. The imagery is being acquired for use in the development
  of the ESI (Environmental Sensitivity Index) data in this same region. The entire
  project area includes approximately 11,669 square miles.\",\n\t\"license_title\":
